import React from 'react'
import {Divider, Drawer, Grid, ListItem, makeStyles} from '@material-ui/core'
import { Link } from 'react-router-dom'

const styles = makeStyles({
    root:{
        display:'flex',
        flexDirection:'column',
        padding: '1vw'
    }
})

interface IProps{
    open: boolean
    handleClose: () => void
}

const SideMenu: React.FC<IProps> = (props) =>{

    const {open, handleClose} = props
    const useStyle = styles()

    return(
        <Drawer
            anchor='left'
            open = {open}
            onClose={handleClose}>
            <Grid
                className={useStyle.root}
                container>
                <ListItem><Link to='/1'>To</Link></ListItem>
                <Link to='/'><ListItem></ListItem></Link>
            </Grid>
        </Drawer>
    )
}

export default SideMenu;
